webpackJsonp([33500440668784],{8560:function(t,e){t.exports={pathContext:{group:[{node:{fields:{title:"Market State vs Nation State",date:"10 Jun 2004",slug:"/2004-06-10-market-state-vs-nation-state/",tags:"Y2004"},html:'<p><a href="http://jrobb.mindplex.org/2004/06/10.html#a4888">John Robb:</a> (on the killing of 11 Chinese workers in Afghanistan) "This begs the question:  why are we using market-state techniques (like outsourcing work) in a location that needs nation-state development (ie. local work)?  This is the same mistake we continue to make in Iraq."</p>'},next:{fields:{title:"Gone With The Wind",date:"10 Jun 2004",slug:"/2004-06-10-gone-with-the-wind/"}},previous:{fields:{title:"Wait For Me",date:"10 Jun 2004",slug:"/2004-06-10-wait-for-me/"}}},{node:{fields:{title:"Gone With The Wind",date:"10 Jun 2004",slug:"/2004-06-10-gone-with-the-wind/",tags:"Y2004"},html:'<p><a href="http://www.spiegel.de/panorama/0,1518,303393,00.html" title="Gewittersturm: Weltuntergangsstimmung in Norddeutschland - Panorama - SPIEGEL ONLINE"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/06/burning_wka.jpg" alt="Burning wind generator after being struck by lightning" border="0" align="right" /></a>Yesterday\'s severe thunderstorm in northern Germany provided one solution to <a href="http://www.spiegel.de/panorama/0,1518,303393,00.html" title="Gewittersturm: Weltuntergangsstimmung in Norddeutschland - Panorama - SPIEGEL ONLINE">getting rid of unwanted wind generators</a>.</p>'},next:{fields:{title:"Work Less Harder",date:"09 Jun 2004",slug:"/2004-06-09-work-less-harder/"}},previous:{fields:{title:"Market State vs Nation State",date:"10 Jun 2004",slug:"/2004-06-10-market-state-vs-nation-state/"}}},{node:{fields:{title:"Work Less Harder",date:"09 Jun 2004",slug:"/2004-06-09-work-less-harder/",tags:"Y2004"},html:'<p>When I first saw this graph of the CPU usage at my web host for the last month, I thought that WordPress was using less CPU than Movable Type had. </p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/06/1month-cpumins.png" alt="CPU activity for 1 month" /></p>\n<p>But then I remembered that I turned off a busy database cron job at the same time I switched blog software. That must explain it, since MT is busy in spurts, not continuously like in the graph.</p>'},next:{fields:{title:"Why'd You Cry-y-y, For The Guy-y-y, Say Goodby-y-ye",date:"09 Jun 2004",slug:"/2004-06-09-whyd-you-cry-y-y-for-the-guy-y-y-say-goodby-y-ye/"}},previous:{fields:{title:"Gone With The Wind",date:"10 Jun 2004",slug:"/2004-06-10-gone-with-the-wind/"}}}],pathPrefix:"",first:!1,last:!1,index:468,pageCount:1101}}}});
